import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TextField,
  Button,
} from '@mui/material';
import productsMock from '../data/products';

const ProductList = () => {
  const [products, setProducts] = useState(productsMock);
  const [editingRow, setEditingRow] = useState(null);

  const handleEdit = (id) => {
    setEditingRow(id);
  };

  const handleSave = (id) => {
    setEditingRow(null);
  };

  const handleChange = (id, field, value) => {
    setProducts((prevProducts) =>
      prevProducts.map((product) =>
        product._id === id ? { ...product, [field]: value } : product
      )
    );
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Nom</TableCell>
            <TableCell>Type</TableCell>
            <TableCell>Prix (â‚¬)</TableCell>
            <TableCell>Note</TableCell>
            <TableCell>Garantie (ans)</TableCell>
            <TableCell>Disponible</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {products.map((product) => (
            <TableRow key={product._id}>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    value={product.name}
                    onChange={(e) =>
                      handleChange(product._id, 'name', e.target.value)
                    }
                  />
                ) : (
                  product.name
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    value={product.type}
                    onChange={(e) =>
                      handleChange(product._id, 'type', e.target.value)
                    }
                  />
                ) : (
                  product.type
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    type="number"
                    value={product.price}
                    onChange={(e) =>
                      handleChange(product._id, 'price', parseFloat(e.target.value) || 0)
                    }
                  />
                ) : (
                  product.price.toFixed(2)
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    type="number"
                    value={product.rating}
                    onChange={(e) =>
                      handleChange(product._id, 'rating', parseFloat(e.target.value) || 0)
                    }
                  />
                ) : (
                  product.rating
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    type="number"
                    value={product.warranty_years}
                    onChange={(e) =>
                      handleChange(product._id, 'warranty_years', parseInt(e.target.value) || 0)
                    }
                  />
                ) : (
                  product.warranty_years
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <TextField
                    value={product.available ? 'Oui' : 'Non'}
                    onChange={(e) =>
                      handleChange(
                        product._id,
                        'available',
                        e.target.value.toLowerCase() === 'oui'
                      )
                    }
                  />
                ) : (
                  product.available ? 'Oui' : 'Non'
                )}
              </TableCell>
              <TableCell>
                {editingRow === product._id ? (
                  <Button
                    variant="contained"
                    color="primary"
                    onClick={() => handleSave(product._id)}
                  >
                    Sauvegarder
                  </Button>
                ) : (
                  <Button
                    variant="outlined"
                    color="secondary"
                    onClick={() => handleEdit(product._id)}
                  >
                    Modifier
                  </Button>
                )}
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ProductList;
